Model 10 law enforcement precision carbine in .308 WIN. MSRP $880. Rifle is in new, never fired condition. The LEPC has a 20 inch 1 in 10 inch twist barrel, 4 round detachable box magazine, short action on a digi cam synthetic Accu-Stock. Also has the Exclusive Savage Accu-Trigger. Rifle in photo is the actual rifle for sale. The 4.5-14 Shooters edge scope and Harris bipod can be included in the sale for an additional $200


for more info from the Savage Arms web sight please check out:
http://www.savagearms.com/firearms/model/10+PRECISION+CARBINE
